            modelBuilder.Entity("Data.QA.ExtranetAccessLevel", b =>
                {
                    b.Property<int>("Id")
                        .ValueGeneratedOnAdd()
                        .HasColumnType("int")
                        .HasColumnName("ID")
                        .HasAnnotation("SqlServer:ValueGenerationStrategy", SqlServerValueGenerationStrategy.IdentityColumn);

                    b.Property<bool>("CanAccessCmsfunctionality")
                        .HasColumnType("bit")
                        .HasColumnName("CanAccessCMSFunctionality")
                        .HasComment("True if the user is permitted to access the extended CMS functionality. Initially this is intended only for Net Ent (so should be False for everyone else), but could change in future.");

                    b.Property<bool>("CanAddAndEditCmspublications")
                        .HasColumnType("bit")
                        .HasColumnName("CanAddAndEditCMSPublications")
                        .HasComment("True if the user is permitted to create/edit new CMSPublications. If the user does not have CanAccessCMSFunctionality = True then this will be irrelevant.");

                    b.Property<bool>("CanAddAndEditGlossaryEntries")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to add new glossary entries and to edit existing entries. If the user does not actually have access to any glossaries to begin with then this setting will have no effect.");

                    b.Property<bool>("CanAddAndManageOtherGroupExtranetUsers")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to add new extranet users at the organisation, and for other organisaitons in the group, and to manage their settings/access levels");

                    b.Property<bool>("CanAddAndManageOtherOrgExtranetUsers")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to add new extranet users at the organisation and to manage their settings/access levels");

                    b.Property<bool>("CanAddEditAndLockCmsreleases")
                        .HasColumnType("bit")
                        .HasColumnName("CanAddEditAndLockCMSReleases")
                        .HasComment("True if the user is permitted to create/edit/lock new CMSReleases. If the user does not have CanAccessCMSFunctionality = True then this will be irrelevant.");

                    b.Property<bool>("CanApproveGroupWorkRequestsAboveThreshold")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to approve requests above the monetary threshold submitted by other users at the organisation or other organisations in the group. This user will be permitted to approve anything, so it does not matter if the thresholds differ across the different orgs in a group.");

                    b.Property<bool>("CanApproveOrgWorkRequestsAboveThreshold")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to approve requests above the org's monetary threshold submitted by other users at the organisation");

                    b.Property<bool>("CanDownloadOtherGroupCompletedOrders")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to download completed job items for orders (jobs) submitted by other extranet users at the same organisation or at other organisations attached to the same org group");

                    b.Property<bool>("CanDownloadOtherOrgCompletedOrders")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to download completed job items for orders (jobs) submitted by other extranet users at the same organisation");

                    b.Property<bool>("CanRequestInterpretingServicesWork")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to submit requests for interpreting jobs (of any size) via the extranet. Typically this would be False for any translator/supplier, or for clients who only perform a \"review\" role and are not authorised to spend money on their company''s behalf, or for clients who will never need interpreting and do not want this option to be visible.");

                    b.Property<bool>("CanRequestTranslationFromWithinCms")
                        .HasColumnType("bit")
                        .HasColumnName("CanRequestTranslationFromWithinCMS")
                        .HasComment("True if the user can initiate a translation request from within the CMS/LinguisticDatabase functionality, rather than the \"normal\" route via the uploading of one or more files for translation. If CanAccessCMSFunctionality is False this has no effect.");

                    b.Property<bool>("CanRequestWorkAboveOrgValueThreshold")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to request work/submit orders which are higher in monetary value than the \"approval threshold\" for this organisation. If this is False then the requested work will not be permitted to proceed as a job until a nominated approver at the client org has confirmed it is Ok to go ahead. If no threshold is set for this org then this setting will have no effect.");

                    b.Property<bool>("CanRequestWrittenServicesWork")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to submit translation, transcription, proofreading or other written-service jobs (of any size) via the extranet. Typically this would be False for any translator/supplier, or for clients who only perform a \"review\" role and are not authorised to spend money on their company''s behalf.");

                    b.Property<bool>("CanRerouteReviewJobsToOtherGroupExtranetUsers")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to re-route review assignments intended for one extranet user to a different extranet user at the same organisation or at another org in the same org group");

                    b.Property<bool>("CanRerouteReviewJobsToOtherOrgExtranetUsers")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to re-route review assignments intended for one extranet user to a different extranet user at the same organisation");

                    b.Property<bool>("CanReviewOtherGroupJobsInAnyLanguageCombo")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to use the review functionality to edit/review/approve the text of translations in any language combination, which were originally intended to be reviewed by another extranet user at another organisation within the same organisation group");

                    b.Property<bool>("CanReviewOtherGroupJobsInOwnLanguageCombos")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to use the review functionality to edit/review/approve the text of translations in the language combinations which they are \"responsible for\", which were originally intended to be reviewed by another extranet user at other organisations within the same organisation group");

                    b.Property<bool>("CanReviewOtherOrgJobsInAnyLanguageCombo")
                        .HasColumnType("bit");

                    b.Property<bool>("CanReviewOtherOrgJobsInOwnLanguageCombos")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to use the review functionality to edit/review/approve the text of translations in any language combination, which were originally intended to be reviewed by another extranet user at the same organisation");

                    b.Property<bool>("CanReviewOwnJobsInOwnLanguageCombos")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to use the review functionality to edit/review/approve the text of translations in the language combinations which they are \"responsible for\". These language combinations are specified in ExtranetUserReviewLanguageCombos.");

                    b.Property<bool>("CanSignOffReviewRequestsWithoutViewingFirst")
                        .HasColumnType("bit")
                        .HasComment("True if the user is allowed to click on/activate an \"Approve this review request\" function before viewing the text for review first. In other words, this means they can say \"I don't want to look at this, I just want to approve it anyway\".");

                    b.Property<bool>("CanViewDetailsOfOtherGroupOrders")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to view a list/details of orders (jobs) submitted by other extranet users at the same organisation and at other organisations in the same org group");

                    b.Property<bool>("CanViewDetailsOfOtherGroupUsers")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to view a list/details of other extranet users at the same organisation and at other organisations within the org group. If the org is not attached to a group then this setting would be ignored.");

                    b.Property<bool>("CanViewDetailsOfOtherOrgOrders")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to view a list/details of orders (jobs) submitted by other extranet users at the same organisation");

                    b.Property<bool>("CanViewDetailsOfOtherOrgUsers")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to view a list/details of other extranet users at the same organisation");

                    b.Property<bool>("CanViewLinguisticSuppliers")
                        .HasColumnType("bit")
                        .HasComment("For a handful of clients we want to allow them to see limited supplier details via the extranet application. This is either (a) ONLY our LinguisticSupplier.ID number, for clients where we have agreed they can see an anonymous identifier for the purposes of agreeing to use approved translators and for contacting us to discuss feedback etc.; or (b) the LinguisticSupplier.ID number and the supplier's name, but ONLY when the supplier is a client-internal translator and not one of our freelances. If this is False then all linguistic supplier info is hidden.");

                    b.Property<bool>("CanViewPricingAndCosts")
                        .HasColumnType("bit")
                        .HasComment("True if the user is permitted to view client costs/pricing information. Some customers may want specific users (e.g. reviewers, who may belong to third-party organisations) to not be able to see what we are charging, while still allowing them to do review or even submit a request for translation, etc.");

                    b.Property<string>("Description")
                        .IsRequired()
                        .HasColumnType("nvarchar(max)")
                        .HasComment("A human-readable description summarising what the current access level permits/is designed for");

                    b.Property<string>("Name")
                        .IsRequired()
                        .HasMaxLength(200)
                        .HasColumnType("nvarchar(200)")
                        .HasComment("The human-readable name of this access level, which will appear in the extranet and also in the intranet when managing users internally");

                    b.HasKey("Id");

                    b.ToTable("ExtranetAccessLevels");

                    b
                        .HasComment("Profiles/roles available for users logging into the extranet, which determine which functionality they are permitted to access, whether they can see information about other users, and so on. Levels 1-99 are reserved for \"standard/default\" settings, while anything above 100 is for customer/user-specific settings. Access levels which can be visible to/used by particular groups/contacts/orgs are specified in the ExtranetAvailableAccessLevels table.");
                });

