                    b.Property<DateTime?>("RemovedDateTime")
                        .HasColumnType("datetime")
                        .HasComment("The date/time this entry was removed from the list. This is \"removed\" rather than the more normal \"deleted\" because an entry can be removed once we win the business and so we don't want to regard it as \"deleted\" in the sense of getting rid of it permanently");

                    b.Property<byte?>("RemovedReason")
                        .HasColumnType("tinyint")
                        .HasComment("If set, a number indicating the reason why it was removed from the hot list. Hard-coded for now.\r\n\r\nNULL = not yet removed, i.e. still on the list (in VB.NET we convert this to 0 to help with ENUMs)\r\n1 = we won the business (i.e. it will now appear in forecasts, etc.)\r\n2 = we did not win the business\r\n3 = we never heard a definite answer, so tidying up the list\r\n4 = deleted as it was an error of some sort");

                    b.Property<byte>("WinChancePercentage")
                        .HasColumnType("tinyint")
                        .HasComment("A figure of between 1 and 99 indicating the percentage win chance, as judged by the salesperson within our guidelines, indicating how likely they think we are to win this business. Zero is not allowed (as it means we definitely will not win it), nor is 100 (as it means we definitely have won it), as in either case it should be removed from the hot list. The figure is subsequently used in weighted calculations (e.g the AdjustedAnnualGBPSpend and AdjustedGBPSpendWithUsThisFY) to help with overall forecasting.");

                    b.HasKey("Id");

                    b.ToTable("SalesHotlistEntries");

                    b
                        .HasComment("Entries added to salespeople's hot lists - list of current/interesting opportunities which they are aiming to win as customers of translate plus");
                });

